import { mapState } from "vuex";
import WangEditor from "@/components/wangEditor/index.vue";
import { agentAgreement, agentAgreementSave } from "@/api/user";

export default {
  components: { WangEditor },
	computed: {
	  ...mapState("admin/layout", ["isMobile","menuCollapse"])
	},
  data() {
    return {
      ueConfig: {
        autoHeightEnabled: false,
        initialFrameHeight: 500,
        initialFrameWidth: "100%",
        UEDITOR_HOME_URL: "/admin/UEditor/",
        serverUrl: "",
      },
      id: 0,
      agent: {
        // title: "",
        content: "",
        status: 1,
      },
      content:'',
      spinShow: false,
    };
  },
  created() {
    this.agentAgreement();
  },
  methods: {
    getEditorContent(data) {
      this.agent.content = data;
    },
    agentAgreement() {
      this.spinShow = true;
      agentAgreement()
        .then((res) => {
          this.spinShow = false;
          const { title, content, status, id } = res.data;
          // this.agent.title = title;
          this.agent.content = content;
          this.content = content;
          this.agent.status = status;
          this.id = id || 0;
        })
        .catch((err) => {
          this.$Message.error(err);
          this.spinShow = false;
        });
    },
    // 保存
    agentAgreementSave() {
      this.$Spin.show();
      agentAgreementSave(this.id, this.agent)
        .then((res) => {
          this.$Spin.hide();
          this.$Message.success("保存成功");
          this.agentAgreement();
        })
        .catch((err) => {
          this.$Spin.hide();
          this.$Message.error(err.msg);
        });
    },
  },
};
